import { Container, Row, Form } from "react-bootstrap"
import { Typeahead } from 'react-bootstrap-typeahead'
import { useState } from "react";

import 'react-bootstrap-typeahead/css/Typeahead.css';

export default function Order() {

    const [selected, setSelected] = useState([]);
    const products = [
        {
            id: 1,
            label: "Name product",
            price: 20,
            qty_stock: 10
        }
    ]

    return (
        <Container fluid>
            <Row>
                <Form>
                    <Form.Group lassName="mb-3" controlId="formBasicClientName">
                        <Form.Label>Nome cliente: </Form.Label>
                        <Form.Control type="text" placeholder="Insira nome cliente"></Form.Control>
                    </Form.Group>
                    <Form.Group lassName="mb-3" controlId="formBasicDeliveryDate">
                        <Form.Label>Data de entrega: </Form.Label>
                        <Form.Control type="date" placeholder="Insira data de entrega"></Form.Control>
                    </Form.Group>
                    <Form.Group lassName="mb-3" controlId="formBasicAddProducts">
                        <Form.Label>Adicionar produtos: </Form.Label>
                        <Typeahead
                            id="basic-example"
                            onChange={setSelected}
                            options={products}
                            placeholder="Escolha um produto..."
                            selected={selected}
                        />
                    </Form.Group>
                </Form>
            </Row>
        </Container>
    )

}


